window.bookSummaryJSON = "<p>In this world there’s two kinds of people, my friend. Those who stand firm, and those who lay down and die.</p> <p>Connor Mills is just trying to make a good life in a world he wasn’t born to. He may have broken the goblins’ hold over his town, but the fight isn’t over.</p> <p>The shadowy patron of the fallen goblin tycoon is out for revenge, and Connor has much more to lose now. His ranch is back on its feet, but the forces that rule Faerie aren’t done with him.</p> <p>When the bounty hunters come calling and darker things raise their heads, Connor must find allies to protect the people he holds dear – and take a risk that may cost him everything.</p> <p>Because even in Faerie, you can only push a good man so far.</p> <p>Red Elf Ranch 2 is an isekai fantasy adventure in the theme of classic Western pulp cinema.</p>"; 
